import { Fragment } from "react";
import Header from './header.js'

const Phonebook = ({ header, data }) => { return (
    <Fragment>
        <Header text={ header } />
        <div className={ 'list' }>
            { data.map(entry =>
                <div className={ 'item' } key={ entry._id }>
                    <div>{ entry.name }</div>
                    <div>{ entry.number }</div>
                </div>
            )}
        </div>
    </Fragment>
)}

export default Phonebook;
